import React from "react";
import notes from "../notes";

var addedNotes = notes.map(function(item) {
  return (
    <div>
      <h1></h1>
      <p></p>
    </div>
  )
})

console.log(addedNotes);

function Note() {
  return (
    <div className="note">
      <h1>This is a Heading</h1>
      <p>This is a content</p>
    </div>
  );
}

export default Note;
